import os

def get_elfs(working_dir):
    elf_files = []
    for root, dirs, files in os.walk(working_dir):
        for file in files:
            if file.endswith('.elf'):
                elf_files.append(os.path.join(root, file))
    return elf_files

def update_elfs(working_dir):
    os.chdir(working_dir)
    elf_files = get_elfs(".")
    for f in elf_files:
        os.chmod(f, 0o777)

